Don't Pull It Out

Health-Medical Documentary hosted by Gary Beadle, published by Discovery Channel broadcasted as part of DC Body Invaders series in 2012 - English narration


Information
------------------------------

Body Invaders



Don't Pull It Out

How did that get there and how did they get it out? Those are going to be the two questions you ask yourself when you watch this brand new series. A Christmas tree, a pair of shears, the spike on top of a set of railings, and a full set of cutlery!? All of these foreign objects have somehow inserted themselves into someone. We talk to the victims, eye-witnesses, recreate the gory accidents and show you the gruesome x-rays that show where those bodies got invaded. And, more importantly, how the medical professionals managed to extract the objects and save the victims' lives.

In Scotland, a woman leaves for work and five minutes later ends up with her head impaled on a thirteen centimeter iron spike. In Australia, a young father goes fishing with friends. One of them accidentally shoots him with a spear a metre and half long and our hero nearly dies on a remote beach. Nowhere is safe, as a 86 year- old American pottering around his garden discovers when he falls on his garden shears. They get lodged in his eye, with the handle right beside a vital artery. This episode delves in to the strange, but true world, of unlucky encounters with deadly body invaders. It's crammed full of useful information about what to do in these extreme situations - the most important advice is &quot;Don't pull it out&quot;. Thanks to the skill of the doctors, the stories are crowned with heart-warming resolutions to the most desperate situations.

